/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 trigger update_everyday_plan after update on everyday_plan for each row
    begin
        declare unFinish int;
        set unFinish = (select count(*) from everyday_plan as ep join problem_correction as pc on ep.correction_id = pc.id where report_id = new.report_id and TO_DAYS(date) = TO_DAYS(CURDATE()) and state < pc.movement_set);
        update plan set current_duration = current_duration + 1 where unFinish = 0 and report_id = NEW.report_id;
    end */;;
DELIMITER ;
